coeff = [1 2 7 10 7 1] %[output:69d21e8c]
%%
function routh_table = routh(coeff)
    n = length(coeff);
    m = ceil(n/2);                  % number of columns
    routh_table = zeros(n, m);

    % first row (even coefficients)
    even_coeffs = coeff(1:2:end);
    routh_table(1,1:length(even_coeffs)) = even_coeffs;

    % second row (odd coefficients)
    odd_coeffs = coeff(2:2:end);
    routh_table(2,1:length(odd_coeffs)) = odd_coeffs;

    % fill the rest of the table
    for i = 3:n
        for j = 1:m-1
            a = routh_table(i-1,1);
            b = routh_table(i-2,1);
            if abs(a) < 1e-12   % handle zero pivot case
                routh_table(i,j) = 0;
            else
                routh_table(i,j) = ((a * routh_table(i-2,j+1)) - ...
                                    (b * routh_table(i-1,j+1))) / a;
            end
        end
    end
end
%%
R = routh(coeff) %[output:91d1ca61]

disp('Routh Table:'); %[output:1b637a35]
disp(R); %[output:64dc2c25]
%%
function [isStable, signChanges] = check_stability(routh_table)
    % Extract first column
    first_col = routh_table(:,1);

    % Remove exact zeros (to avoid false sign flips)
    first_col = first_col(first_col ~= 0);

    % Count sign changes
    signChanges = sum(diff(sign(first_col)) ~= 0);

    % Stability condition
    isStable = (signChanges == 0);
end
%%
[stable, changes] = check_stability(R);

if stable %[output:group:7dcd6d2c]
    fprintf('System is stable (no RHP poles).\n'); %[output:7915fcca]
else
    fprintf('System is unstable (%d RHP poles).\n', changes);
end %[output:group:7dcd6d2c]
%%
syms K
coeff = [1 2 7 10 7 1];

% Characteristic polynomial with K
char_poly = sym(coeff);
char_poly(end) = coeff(end) + K;

% Order and number of columns
n = length(char_poly);
m = ceil(n/2);

% Initialize symbolic Routh table
R = sym(zeros(n, m));

% First two rows
odd_idx  = 1:2:n;
even_idx = 2:2:n;
R(1,1:length(odd_idx)) = char_poly(odd_idx);
R(2,1:length(even_idx)) = char_poly(even_idx);

% Fill remaining rows
for i = 3:n
    for j = 1:m-1
        a = R(i-1,1);
        b = R(i-2,1);
        if a == 0
            R(i,j) = 0;
        else
            R(i,j) = simplify((a*R(i-2,j+1) - b*R(i-1,j+1))/a);
        end
    end
end

disp('Routh Table (symbolic):'); %[output:77c81447]
disp(R); %[output:1e68f4ef]

% --- Stability conditions: first column > 0 ---
first_col = simplify(R(:,1));

disp('First column of Routh table:'); %[output:959f1273]
disp(first_col); %[output:66b3ebbb]

% Convert to numeric functions of K
first_col_fun = matlabFunction(first_col);

% Sweep K values to check stability
Kvals = -10:0.01:20;   
stable_idx = arrayfun(@(k) all(double(first_col_fun(k)) > 0), Kvals);

% Extract contiguous stable interval(s)
stable_K = Kvals(stable_idx);
if isempty(stable_K) %[output:group:42a2ee39]
    disp('No stability range found.');
else
    Kmin = min(stable_K);
    Kmax = max(stable_K);
    fprintf('System is stable for %.3f < K < %.3f\n', Kmin, Kmax); %[output:8b6f7bce]
end %[output:group:42a2ee39]

%%
G = tf(1, coeff);
poles_open = pole(G) %[output:12baf529]
figure; %[output:8c38feee]
plot(real(poles_open),imag(poles_open),'bx','MarkerSize',8,'LineWidth',1.5); %[output:8c38feee]
yline(0,'k--'); xline(0,'k--'); %[output:8c38feee]
xlabel('Real Axis'); ylabel('Imag Axis'); %[output:8c38feee]
title('Open-loop Poles of G(s)'); %[output:8c38feee]
grid on; %[output:8c38feee]
%%
T = feedback(G,1);
poles_closed = pole(T);

figure; %[output:68ce75e9]
plot(real(poles_closed), imag(poles_closed), 'bx','MarkerSize',8,'LineWidth',1.5); %[output:68ce75e9]
yline(0,'k--'); xline(0,'k--'); %[output:68ce75e9]
xlabel('Real Axis'); ylabel('Imag Axis'); %[output:68ce75e9]
title('Closed-loop Poles for K = 1'); %[output:68ce75e9]
grid on; %[output:68ce75e9]
%%
Kmin = 0.0;
Kmax = 5.123;   

% Root locus plot
figure; %[output:26fdd9fd]
rlocus(T); hold on; %[output:26fdd9fd]
title('Root Locus of G(s) with Gain K'); %[output:26fdd9fd]
xlabel('Real Axis'); ylabel('Imag Axis'); grid on; %[output:26fdd9fd]

Tmin = feedback(Kmin*T, 1);
poles_min = pole(Tmin);
plot(real(poles_min), imag(poles_min), 'ro', 'MarkerSize', 8, ...
    'LineWidth', 1.5, 'DisplayName', sprintf('Poles @ K=%.2f', Kmin));

Tmax = feedback(Kmax*T, 1);
poles_max = pole(Tmax);
plot(real(poles_max), imag(poles_max), 'go', 'MarkerSize', 8, ... %[output:26fdd9fd]
    'LineWidth', 1.5, 'DisplayName', sprintf('Poles @ K=%.2f', Kmax)); %[output:26fdd9fd]

legend show; %[output:26fdd9fd]
%%
[y, tOut] = step(G);
figure; %[output:3a8209b0]
plot(tOut, y); %[output:3a8209b0]
title('Step Response'); %[output:3a8209b0]
xlabel('Time (seconds)'); %[output:3a8209b0]
ylabel('Response'); %[output:3a8209b0]
grid on; %[output:3a8209b0]
%%
num_with_zero = [1 2];   % added zero at -2
den = coeff;
G_with_zero = tf(num_with_zero, den);

figure; %[output:07bb8e9f]
rlocus(G_with_zero); %[output:07bb8e9f]
title('Root Locus with Added Zero at s = -2'); %[output:07bb8e9f]
xlabel('Real Axis'); ylabel('Imag Axis'); grid on; %[output:07bb8e9f]

